import { useMemo } from "react";
import PropTypes from "prop-types";
import styles from "./GroupComponent1.css";

const GroupComponent1 = ({
  className = "",
  missionStatement,
  loremIpsumDolorSitAmetCon,
  propBackgroundColor,
  propWidth,
  propFlex,
}) => {
  const groupDiv1Style = useMemo(() => {
    return {
      backgroundColor: propBackgroundColor,
      width: propWidth,
      flex: propFlex,
    };
  }, [propBackgroundColor, propWidth, propFlex]);

  return (
    <div
      className={[styles.rectangleParent, className].join(" ")}
      style={groupDiv1Style}
    >
      <div className={styles.frameChild} />
      <div className={styles.statementIntroduction}>
        <h1 className={styles.missionStatement}>{missionStatement}</h1>
      </div>
      <div className={styles.loremIpsumDolor}>{loremIpsumDolorSitAmetCon}</div>
    </div>
  );
};

GroupComponent1.propTypes = {
  className: PropTypes.string,
  missionStatement: PropTypes.string,
  loremIpsumDolorSitAmetCon: PropTypes.string,

  /** Style props */
  propBackgroundColor: PropTypes.any,
  propWidth: PropTypes.any,
  propFlex: PropTypes.any,
};

export default GroupComponent1;
